const graph = GraphBuilder()
.edge("S", "A", 2)
.edge("S", "B", 4)
.edge("A", "B", 1)
.edge("A", "C", 2)
.edge("B", "C", 3)
.build();

const dijkstra = DijkstraStrategy(graph);

//Prints the shortest path from S to C
console.log(dijkstra.shortest('S','C'));

